import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="pilares-header">
      <div className="header-container">
        <div className="pilares-logo">
          <div className="logo-icon"></div>
          <span className="logo-text">PiLARES</span>
        </div>
      </div>
    </header>
  );
};

export default Header;
